import React from 'react';
import './board-styles.css';

const Board = ({ cells }) => {
    return (
        <div className = "board">
            {cells.map((cell) =>(
                <div key={cell.pos}>{cell.pos}</div> // here we create an array of divs, one for each cell
            ))}
        </div>
    );
};

export default Board;
